import { Component } from "react";

class WebBoardViewComponent extends Component{
    constructor(props){
        super(props);
    }

    componentDidMount(){
        this.reloadWebBoardView();
    }
    
    reloadWebBoardView(){
        console.log("call reloadWebBoardView");
    }

    render(){
        return (
            <>
            hello view
            </>
        ); 
    }
}

export default WebBoardViewComponent;
